  false,\n\t\"url\": null,\n\t\"notes\": \"This collection of narrative reports for
  Carolina Sandhills National Wildlife Refuge summarizes refuge activities from January
  through December 1963. The report begins with a summary of weather and habitat conditions
  during the period. Wildlife including migratory birds, upland game birds, big game
  animals, fish, and furbearers is also covered. A refuge development and maintenance
  section covers physical development, farming activities, and fires. A resource management
  section discusses grazing, fur harvest, and forestry. A public relations section
  outlines recreational use and refuge visitation. Items of interest are provided
  at the end of the report.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
